import { Grid, Typography, Button, TextField, Stack } from "@mui/material";
import React from "react";
import NavBar from "./components/Navbar";


import "./login.css";

export default function LoginPage() {
  return (
    <div>
      <NavBar />

      <Grid
        container
        justifyContent={"center"}
        spacing={"15em"}
        sx={{
          padding: "8.5em 5em",
        }}
      >
        <Grid item width={"45%"}>
          <Typography variant="h2" color={"#ffffff"}>
            Check out our <span style={{color:"#308335"}}>NEW</span> crop recognition software
          </Typography>
        </Grid>
        <Grid item width={"45%"}>
        <div>
      <form className="login_form">
        <Typography
          variant="h2"
          textAlign={"center"}
          sx={{
            marginBottom: "1em",
            color: "#ffffff",
          }}
        >
          LOGIN
        </Typography>
        <Stack alignItems={"center"} spacing={6}>
          <div>
            <TextField
              required
              id="filled-required"
              label="Email"
              placeholder="Email"
              variant="filled"
              sx={{
                background: "#ffffff",
                borderRadius: "10rem",
                width:"20em"
              }}
            />
          </div>
          <div>
            <TextField
              id="filled-password-input"
              label="Password"
              type="password"
              autoComplete="current-password"
              variant="filled"
              sx={{
                background: "#ffffff",
                borderRadius: "10rem",
                width:"20em"
              }}
            />
          </div>
          <div className="form_button">
            <Button variant="contained" type="submit">Submit</Button>
          </div>
          <div>
            <Typography variant="body1" sx={{ color: "#ffffff" }}>
              Don't have an account? <span style={{color:"#308335"}}> Signup </span>
            </Typography>
          </div>
        </Stack>
      </form>
    </div>
        </Grid>
      </Grid>
    </div>
  );
}
